export default function user(state = [], action) {
  if (action.type === 'ADD_USER'){
    console.log(`Данные о регистрации пользователя:\n
      Имя:${action.data.name}\n
      ${action.data.email} ${action.data.date} ${action.data.password}`)
    return action.data
  }
  return state;
}
